// export default RestaurantList;

import React from 'react'

const RestaurantList = ({data}) => {

  const renderList = (data) => {
    data.forEach((item) => {
      return <div>{item}</div>
    })
  }

  return (
    <div>
      {renderList(data)}
    </div>
  );
}

export default RestaurantList;
